package stages

import (
	constants "github.com/erigontech/erigon-lib/chain"
	"github.com/erigontech/erigon-lib/common/hexutil"
	"github.com/erigontech/erigon/zk/tx"
	"github.com/stretchr/testify/require"
	"testing"
)

func Test_DecodeNew(t *testing.T) {
	scenarios := map[string]string{
		"fork12_Only_Type2_Txs":      "",
		"fork12_Type2_And_Type0_Txs": "",
		"fork12_965Transactions":     "",
	}

	for name, data := range scenarios {
		t.Run(name, func(t *testing.T) {
			batchData, err := hexutil.Decode(data)
			require.NoError(t, err)

			_, err = tx.DecodeBatchL2Blocks(batchData, uint64(constants.ForkID12Banana))
			require.NoError(t, err)
		})
	}
}
